import React from 'react';

export default function App() {
  return (
    <iframe
      title="Luccas Profile"
      src="https://luccas00.github.io/index.html"
      style={{
        position: 'fixed',
        inset: 0,                // top/right/bottom/left = 0
        width: '100%',
        height: '100dvh',        // cobre viewport real (melhor que 100vh em mobile)
        border: 'none',
        outline: 'none',
        display: 'block'
      }}
      loading="lazy"
    />
  );
}
